class Solution:
    def solution(self, stdin: str) -> str:
        lines = stdin.split('\n')
        n = int(lines[0])
        a = list(map(int, lines[1].split()))
        b = list(map(int, lines[2].split()))

        def count_zeros(d):
            c = [d * a[i] + b[i] for i in range(n)]
            return sum(1 for x in c if x == 0)

        d = max(x / y for x, y in zip(a, b) if y != 0)
        return str(count_zeros(d))

